    false,nt"url": null,nt"notes": "This map layer contains the locations and
    attributes of significant, historic earthquakes that caused deaths, property damage,
    and geological effects, or were otherwise experienced by populations in the United
    States, Puerto Rico, and U.S. Virgin Islands. Included are earthquakes located in
    the United States as well as some that occurred in adjacent portions of Canada and
    Mexico. The main sources for the data are Seismicity of the United States, 1568-1989
    and the Preliminary Determination of Epicenters for 1990 to January 2004. This is
    a replacement for the June 1999 map layer.",nt"license_title": null,nt"extras":
